Feliz cumpleaños mi hijo!!❤. Ma vie, mon tout 1er bébé, celui qui m'a appris à être maman, celui qui a fait les frais de mon apprentissage dans ce rôle là... mon parfait grâce à qui le passage s'est fait tout en douceur. Merci de m'avoir choisie comme maman😍. (Putain 15 ans sa mère !!😫).
.
Sinon, voilà le gâteau que je lui ai fait à mon geek d'amour...1er opus d'une longue lignée,  j'en ai pour au moins toute la semaine à vous poster mes préparations de cette folle journée 😂. Mais ça yé c'est fait, j'ai fait tout ce que je voulais faire et tout le monde était content, surtout les principaux concernés. .

