Happy Saturday Gamers 🎉
Between all the craziness of getting settled in to my new studies, having to cope with some personal chaos and then having a delightfully exhausting illness, my week has been pretty intense. However all this madness hasn’t stopped me from spending a short while enjoying Links Awakening! I didn’t plan on getting the game but after seeing everyone’s posts last Friday, I just couldn’t resist. I’m loving this game so far and the characters are SO cute! ☺️
